package cl.cs.interlogica;

import cl.cs.interlogica.entities.Ingredient;
import cl.cs.interlogica.entities.Product;
import cl.cs.interlogica.services.product.ProductService;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import java.sql.Timestamp;
import java.time.Instant;
import java.util.HashSet;
import java.util.Set;

@SpringBootApplication(scanBasePackages = "cl.cs.interlogica")
public class StartUpApplication implements CommandLineRunner {

    public StartUpApplication(ProductService productService) {
        this.productService = productService;
    }

    public static void main(String[] args) {
            SpringApplication.run(StartUpApplication.class, args);
        }

    @Override
    public void run(String... args) throws Exception {
        final String img = "data:image/jpeg;base64,";
        Ingredient ingredient = new Ingredient();
        ingredient.setId(1);
        ingredient.setName("ingredient name");
        Set<Ingredient> ingredients = new HashSet<>();
        ingredients.add(ingredient);
        for (int i = 0; i < 7; i++) {
            Product product = new Product(i, "name" + i, img, new Double(100), Timestamp.from(Instant.now()), i, false, new Double(0), ingredients);
            productService.save(product);
        }
        int i = 8;
        java.sql.Timestamp time = java.sql.Timestamp.valueOf("2007-11-11 12:13:14");
        Product product = new Product(8, "name", img, new Double(100), time, i, false, new Double(0), ingredients);
        time = java.sql.Timestamp.valueOf("2021-06-02 12:13:14");
        Product product20 = new Product(9, "name", img, new Double(100), time, i, false, new Double(0), ingredients);
        productService.save(product);
        productService.save(product20);
    }

    private ProductService productService;
}
